  UnifyGlobalCells(a, b);                                                    \
} else {                                                                     \
  Bind_Local((a), (CELL)(b));                                                \
}

if ((a) < HR) { /* at least one global */                                    \
  if ((b) > HR) {                                                            \
    Bind_Local((b), (CELL)(a));                                              \
  } else {                                                                   \
    UnifyGlobalCells(a, b);                                                  \
  }                                                                          \
} else {                                                                     \
  if ((b) > (a)) {                                                           \
    Bind_Local((a), (CELL)(b));                                              \
  } else if ((a) > (b)) {                                                    \
